import './App.css';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import AppOne from './LecturesMarksPage';


const App = () => {
  return (
    <div className="App">
<BrowserRouter>
<nav>
<ul>
  <li>
    <Link to="/">AppOne</Link>
  </li>
</ul>
</nav>
<Routes>
  <Route path="/" element={<AppOne/>} />
</Routes>
</BrowserRouter>
</div>
  );
}

export default App;
